import React from 'react';

import Photo from './photo';

class Photowall extends React.Component {
    render() {
        return (
            <div className = "photo-grid">
               {
                   this.props.post.map((post, index) => <Photo key = { index } post = {post} />)
               }
            </div>

        )
    }
}

export default Photowall;
